toString:
When formatting php code with include statement, the formatter inserts space every time I run it.

This is causing the problem:
{code}
include function();
{code}
after formating 2x it becomes
{code}
include   function();
{code}

This works OK:
include 'file.php';
include (function());

h3. Steps to Reproduce
JS source may contain 3 types of comments:
{code:javascript}
/**
 * 1. JsDoc comment. Used to document classes and methods.
 */

/*
  2. Block comment. May be used to temporarliy disable regions of code.
*/

/*
 * 2.1. Just another style of block comment.
 * Not so good to disable/enable blocks of code.
 */

// 3. Line comment.

{code}
h3. Actual Result
There is no options allowing to format these 3 types differently.

h3. Expected Result
Should be options for each comment type (e.g. as in Eclipse JavaScript Development Tools).

fromString:
h3. Steps to Reproduce
Open example in JS editor:

Function.prototype.a = function() {
  var method = this, args = arguments;
  return this.apply(this, arguments);
};


h3. Actual Result
Words `this` and `arguments` are not colored (there is no color difference between local variables `method`, `args` and special words `this`, `arguments`).

h3. Expected Result
Words `this` and `arguments` should be colored (differ from other JS text).

