After APSTUD-2811 is implemented for the download case, if a remote connection is connected to multiple projects, downloading a remote file will open the choose-connection dialog, but the "Remember my decision" setting does not work.

Steps to reproduce:

1. Create two web projects in the workspace;
2. Right-click on the Connections node under one of the projects and select "Add New Connection..." to connect the project to a remote site;
3. Connect the other project to the same remote site;
4. Expand the remote site under Connections and double-click on a file to open it in the editor;
5. Modify the file and save;
6. "Choose Connection" dialog should appear; select a connection, make "Remember my decision" checked, and click OK;
7. The file will be downloaded to the selected project, and now repeat step 5.

Expected result: the connection selected in step 6 should be used, and the file should be downloaded to the corresponding project directly.

Actual result: the "Choose Connection" dialog appears again.

toString:
After APSTUD-2811 is implemented for the download case, if a remote connection is connected to multiple projects, downloading a remote file will open the choose-connection dialog, but the "Remember my decision" setting does not work.

Steps to reproduce:

1. Create two web projects in the workspace;
2. Right-click on a project and run Publish > Run Web Deployment Wizard to set up the project with a remote site;
3. In the deployment wizard, make sure "Automatically sync..." option is checked;
4. Repeat step 2 and 3 for the other project, with both connecting to the same remote site;
5. Expand the remote site under Connections and double-click on a file to open it in the editor;
6. Modify the file and save;
7. "Choose Connection" dialog should appear; select a connection, make "Remember my decision" checked, and click OK;
8. The file will be downloaded to the selected project, and now repeat step 5.

Expected result: the connection selected in step 7 should be used, and the file should be downloaded to the corresponding project directly.

Actual result: the "Choose Connection" dialog appears again.

