PHP 5.4 now supports treating objects as functions.
For example:
{code:php}
<?php
class MyClass{  
    function __invoke() {
        return print('hello!'); 
    }
}
$mine= new MyClass();
echo $mine(); // Outputs: 'hello!'
?>
{code}

