I discovered a bug in the Code-Assist, and 'Open declaration' feature.

The bug make the opening of Declaration places for 'constant, variables, classes, methods, functions' impossible to found (even if the FILE which contains the declaration is already opened in the Aptana Studio 3 Editor!).

So, sometimes.. It cannot open declaration (not always, but sometimes), I cannot tell you how reproduce that bug, but, it's certainly reproductible.

For example, imagine that piece of php code, file is saved to the disk in a project:

{code}
<?php
 // You can see the declaration of the constant JUST below:
  define('TABLE_PRODUCTS_TO_DISCOUNT_CATEGORIES', 'products_to_discount_categories');
  // Now, let's use the constant:
    $discount_category_query = tep_db_query("select p.products_id, p.products_quantity, p.products_weight, discount_categories_id from " . TABLE_PRODUCTS ." p left join "
    . TABLE_PRODUCTS_TO_DISCOUNT_CATEGORIES . " using(products_id) where p.products_id in (" . implode(',', $list_of_prdct_ids) . ")");
?>
{code}

Now..

Try to select a php constant used in a php code line as for example *TABLE_PRODUCTS_TO_DISCOUNT_CATEGORIES* and then click with right button and select 'Open Declaration', an error is reported showing in red: {color:red}Current text selection cannot be opened in an editor{color}.

It's not normal I think, since in olds versions of Aptana Studio 3.0.x this thing 'Open Declaration' opened my 'define' line. (and if the define was in other file, then Aptana just open the file and outline the define line! In Aptana Studio 3.2.x it just not effect, and if effect.. just report and error as showned up!).

Is it a bug or a normal new comportment? (can I revert to the old comportment?).

