It's not normal I think, since in olds versions of Aptana Studio 3.0.x this thing 'Open Declaration' opened my 'define' line. (and if the define was in other file, then Aptana just open the file and outline the define line! In Aptana Studio 3.2.x it just not effect, and if effect.. just report and error as showned up!).

Is it a bug or a normal new comportment? (can I revert to the old comportment?).

