Hi,

The PHP source format is adding a new line after the @ operator.

Ex:

@include('file.php');

After Source/Format:

@
include('file.php');

Regards.

toString:
Hi,

The PHP source format is adding a new line after the @ operator.

Ex:

{code}
@include('file.php');
{code}

After Source/Format:

{code}
@
include('file.php');
{code}

Regards.

