I used to work with Zend Studio where it was possible to go to the definition for constants using hyper-linking "ctrl+click" (as for functions, vars, etc.) I switched to Aptana studio 3.0 and customized my way well except on this point. Does anyone knows if it's possible to manage PHP constants in Aptana the same way as with Zend Studio?
Originally from StackOverflow: http://stackoverflow.com/questions/8658594/move-to-the-definition-for-php-constants-in-aptana

Steps to reproduce:
1. Create two php files in the same PHP project:
{quote}
File a.php:
<?php
class TestClass {
const TEST_CONST1 = 0;
const TEST_CONST2 = -1;
const TEST_CONST3 = 5;
const TEST_CONST4 = -5;
}

File b.php:
<?php
TestClass::TEST_CONST1;
{quote}

2. Hold Ctrl and hovering over the TEST_CONST1 in b.php.
3. Click link. 

Actual result: No link appears.
Expected Result: Clicking that link opens a.php on line 3.

