Since the last update to 2.0.1.201204132053-13042012205605, js files that are opened - and are not part of a Titanium project - do not get validated by jsLint. If you open a js file that is in a project and make an error, the error appears straight away.
The same is not true for files outside projects, they don't get validated at all.

h3. To Test

# Create a new JS file on your desktop. Ensure that JSLint validation is on in preferences
# Add the following content: \\
{code}
function test1() {

var a = 0;
var b = null;
var a = null;

}
{code}
# Drag the file from the desktop into the editor area of Studio to open it (or open it via the File menu or Local Filesystem node)
# In 3.0.9, you will be warned about the duplicate assignment of a. In 3.1.1, the validation doesn't happen.

