For example:
<?php
class test {
    private $bli = array(/* bla */);
}
?>

Details from troubleshooter:
(Build 3.0.0.1332346356) [ERROR]  Formatted content differ around position 47
INPUT:
y();
}
?>
/* */

OUTPUT:
y();
}
?>


I've also seen problems with comments between if and else statements; but I can't seem to reproduce the errors there. iirc it was something like this:
if ($bli == true) {
    doStuff();
} // A comment

