toString:
Certain comments will cause the formatter to fail.
For example:
{code:php}
<?php
class test {
    private $bli = array(/* bla */);
}
?>
{code}

Details from troubleshooter:
{quote}
(Build 3.0.0.1332346356) [ERROR]  Formatted content differ around position 47
INPUT:
y();
}
?>
/* */

OUTPUT:
y();
}
?>
{quote}

I've also seen problems with comments between if and else statements; but I can't seem to reproduce the errors there. iirc it was something like this:
{code:php}
if ($bli == true) {
    doStuff();
} // A comment

// A comment
else if ($bla == true) {
    doOtherStuff();
}
{code}

Same goes for complex assoc. arrays (might be the comma on the last element) same as before, hard to reproduce in test code:
{code:php}
$config['button'] = array(
    'label' => array(
        'left' => 0,
        'fontsize' => 0,      // signal not to use count
    ),
