fromString:
The behaviour on the code assist for colons seems to have changed or is broken:

{code:php}
<?php

switch(true)
{
  case 'foo':
}
{code}

None of the suggested options are relevant to a case statement (see attached screenshot).

Also, it picks the first option as soon as you hit enter (see 2nd screenshot), which is what you usually do for a case statement to provide the code block on the next line. I can't imagine anyone would want this as the default behaviour which is why I think it may be a bug.

