* stop using <Function> wrapper
* refactor out utility classes to determine if a type is a function
* refactor existing classes to use unity methods

Handling functions is a bit different than any other type in the type system. Functions derive from "Object". As a result, new properties can be added to function instances. Functions also my be invoked, taking a possibly empty list of arguments and possibly returning a value. The type system keeps track of these two bits of information in separate locations. If properties are added to the Function, then a new sub-type of Function is created. However, parameters and return values are captured on the property that references the function type. This makes for some difficulties in the current inferencing engine.

As we infer types for nodes in an AST, we need to be able to determine return types of invoked functions. We do this using a function signature: Function<typeName>(paramTypeList):returnTypeList.

* "typeName" represents the name of the Function subtype. It is wrapped in "Function<>" so we know this type is a Function (invokable) without having to traverse its ancestor hierarchy.
* "paramTypeList" is a list of types, one for each parameter. Note that a single parameter may have a collection of types. This information is used for inferencing inside of the function's scope only.
* "returnTypeList" is a list of types that are returned by the function when it is invoked. These types are used by the inferencing engine when it processes invocations.

When we ask for the type of a property, we return a list of types as a list of strings. When asking for the type of a function property specifically, we need to return a function signature. This notion was confused and the Function<typeName> aspect of the signature was used as the type name as well. We really only need "typeName(paramTypeList):returnTypeList". Using "Function<typeName>" makes it difficult to look up "typeName" since you have no idea when to use just "typeName" versus "Function<typeName>". For example, the jQuery library is defined by an sdocml file. Its constructors return a jQuery type; however, internally, we say that the jQuery global method is of type "Function<jQuery>". So, any time we see the type "jQuery", we have to map it to "Function<jQuery>". By removing the notion of "Function<>" from function types, we should be able to avoid this hack and a few others.

The challenge of this change comes from refactoring the code to no longer rely on the "Function<>" notation. If a function is being accessed like an object, then treating the function like any other object will be just fine. For example, in the following:

{code}
function abc() { return ""; }
abc.name = "";
abc.|
{code}

If you place the cursor at '|' and ask for content assist, then inferencing will look up abc's type and find that it is "abc:String". At this point, inferencing simply queries the index for "abc" and then displays all properties on that type in the proposal list. However, if you change the code slightly:

{code}
function abc() { return ""; }
abc.name = "";
abc().|
{code}

Things get a little more challenging. "abc()." is actually a "get-property" node with "abc()" on its left-hand side. This is further defined as an invoke node with an identifier node as a child. The child of an invoke node can be an arbitrary expression, so we can't rely on that child always being an identifier. This means that we have to infer the type of the child of the invoke node. In this case, we get "abc" which is type "abc". We're now at the line between types and properties. We access the "abc" type, but for purposes of invocation, we need the "abc" property, off of Window in this case, because that property tells us that it is a function that returns "String". It's type information doesn't tell us this. And this is were the challenge lies. The invocation node actually needs to infer what is called a Reference.

A Reference is a tuple composed of an object and a property name. Inferencing has been setup to return type info as strings, so the fact that we need a Reference here breaks our inferencing code around function invocation. Remember that the child of JSInvokeNode has to be inferred. This could be an arbitrarily complex subtree that touches most of the current cases handled by the inferencing engine. The engine uses strings which implies we would have to build a parallel system to return a Reference instead. That would be a horrible maintenance pain in the neck. So, this is why inferencing uses function signatures. These can be returned as strings and it preserves the return type info of the function, all without having to use References and a parallel system for those. So, in theory, we should be able to simply remove "Function<>" from the type name and then anywhere in inferencing where we need to differentiate between a function or a property, we can look up the ancestor chain of the type to determine if it derives from Function. Ideally, this could be cached in some way so we don't have to hit the index tons of times during inferencing. Even though we have a utility method to get a full ancestor chain of a type, this requires one read per ancestor type. For performance reasons, we should always minimize reads/writes to the index if possible.

