PDT has an "Open Method" that allows the user to navigate to any method/class in any PHP file in a project/workspace.  This makes it a lot easier to locate a particular method or browse methods when looking the right method to use.  The list of methods is filterable (find as you type) and allows wildcards ({{*}}) as well to allow more flexible method listings.

Now that Aptana Studio 3 conflicts with PDT so that PDT's editor no longer works properly, it would be great if Aptana Studio added this feature to further round out the workflow that was lost from PDT.

For reference, the "Open Method" feature in PDT is launched via the following shortcut by default: {{CTRL+SHIFT+M}}

{code}
<?php
class DemoClass {
    private $instance;

    public static function getInstance() {
           self::$instance ||   self::$instance = new self();
           return   self::$instance;
    }

    public function hello() {
          echo 'hello';
    }

    public function world() {
          echo 'world';
    }
}
?>
{code}

In some context locations, the code assist may pop-up automatically to suggest available options. For example, an available list of functions, variables and constants will appear after typing a PHP arrow string '->'.

Call other class methods do not work.

there was no code assist when used like this

{code}
DemoClass::getInstance()->??? ??? cant tips likehello world...methods
{code}

